t be worth a look, but keep in mind it\'s a work in progress.</p>\r\n\r\n<p>As with most things Drupal, there are a lot of ways one might chose to configure an Omega-based site. The path I\'ve chosen with this starterkit is to use a combination of Omega 4 layouts and Display Suite. To see how things are put together, look under Theme settings, Display Suite and Context. </p>\r\n\r\n<p>I think this approach allows the best of both worlds - control at the theme layer using layouts, as well as the amazing flexibility of Display Suite. As you may know the GUI tools that were included in Omega 3 are gone. While it\'s true that Display Suite doesn\'t offer a true replacement, it has a lot of goodies that make theming a Drupal website a lot easier.</p>\r\n\r\n<p>You can download this installation profile on the post that <a href=\"http://friendlymachine.net/posts/omega-4-starterkit\">discusses the starterkit</a> on Friendly Machine. Have fun playing around with Omega 4!</p>\r\n','','full_html'),('node','article',0,4,4,'und',0,'<p>Dolor ille sagaciter si suscipit. Distineo facilisis fere valde. Adipiscing macto nisl nobis ratis ulciscor ullamcorper. Esca melior nimis praesent sagaciter ulciscor. Adipiscing duis laoreet magna minim obruo persto quae refoveo virtus.</p>\r\n\r\n<p>Caecus defui ea pagus si utinam. Damnum diam erat hos incassum persto probo secundum tego zelus. Camur elit loquor luctus nisl valde vicis. Loquor ludus nutus. Aliquip defui facilisi facilisis hendrerit persto quae tego valetudo zelus.</p>\r\n\r\n<p>Antehabeo camur distineo erat obruo quibus refero refoveo scisco tego. Abdo ad cui exputo fere iustum jumentum modo nimis. Bene commoveo gilvus illum olim secundum vulputate. Capto cogo in jus magna metuo nisl oppeto.</p>\r\n<!--break-->\r\n\r\n<p>At ea esca exputo hos lenis neque nulla ymo. Hos humo importunus lenis luptatum obruo pagus patria quidne. Consectetuer laoreet roto validus vulpes. Acsi augue plaga praesent secundum. At bene facilisi paulatim 